DROP TABLE IF EXISTS sales;
DROP TABLE IF EXISTS salesrep;

CREATE TABLE salesrep(
                         salesRepID  INTEGER CONSTRAINT PK_salesrep
                             PRIMARY KEY
                             GENERATED ALWAYS AS IDENTITY NOT NULL,
                         name        VARCHAR(60) ,
                         office      VARCHAR(45)
);

CREATE TABLE sales(
    Order_ID        INTEGER
                        CONSTRAINT pk_sales PRIMARY KEY
                        GENERATED ALWAYS AS IDENTITY NOT NULL,
	Order_Date      TIMESTAMP,
	Customer_Name   VARCHAR(50),
	SalesRepId      INTEGER CONSTRAINT fk_sales_salesrepid REFERENCES salesrep(salesRepID),
	Amount          INTEGER
);







